import React from "react";

class AddFishForm extends React.Component {
  render () {
    return (
     <form>
      <input type="text" />name
      <input type="text" />price
      <input type="text" />status
      <input type="text" />desc
      <input type="text" />image
     </form>
    )
  }
}

export default AddFishForm;
